import React from 'react';


const PostStamp = (props) => {
    return (
        <img 
            src="https://s3-us-west-2.amazonaws.com/s.cdpn.io/3/Harry-Potter-1-.jpg"> 
            className="postStamp"
            width="200rem"
            height="120rem"
        >
        </img>

    );

}


export default PostStamp;
